import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-header-back">
          <p className="App-header-title">Felicidad Mundial</p>
        </div>
        <div className="App-map"></div>
      </header>
    </div>
  );
}

export default App;
